import React,{Component} from "react";

class MySecondClassComponent extends Component{
    state={
        balance:0,
        pin:177767,
    };
    balanceIncrement=(value)=>{
        this.setState({balance: this.state.balance + value});
    }

    onClickHandler=()=>{
        console.log("Your OTP is 173422");
    }

    onProfitClickHandler= ()=>{
        this.balanceIncrement(1);
    }

    onDoubleProfitClickHandler= ()=>{
        this.balanceIncrement(100);
    }
    render(){

        const{name, age, account}=this.props;
        return(
        <>
       <h1>Hi my name is {name}, Im {age} years old, And my balance is {this.state.balance} in Account {this.props.account}</h1>

         <button onClick={this.onClickHandler}>Click here for OTP</button>
         <button onClick={this.onProfitClickHandler}> profit 1X</button>
         <button onClick={this.onDoubleProfitClickHandler}>profit 100X</button>
       </>
        );
    }

}
export default MySecondClassComponent;
